// App.tsx
import React from 'react';

const SpecialOffers: React.FC = () => {
  return (
    <div style={{ display: 'flex' }}>
      {/* First Column */}
      <div style={{ flex: '1 1 50%' }}>
        {/* Sub-Column 1 */}
        <div style={{ display: 'flex', flexDirection: 'column', height: '100%' }}>
          {/* ImageView */}
          <div style={{ flex: '1', border: '1px solid black', textAlign: 'center' }}>
            <img
              src="https://via.placeholder.com/150"
              alt="Sample"
              style={{ maxWidth: '100%', maxHeight: '100%', objectFit: 'cover' }}
            />
          </div>
        </div>

        {/* Sub-Column 2 */}
        <div style={{ display: 'flex', flexDirection: 'column', height: '100%' }}>
          <div style={{ flex: '1', border: '1px solid black' }}>Text 1</div>
          <div style={{ flex: '1', border: '1px solid black' }}>Text 2</div>
          <div style={{ flex: '1', border: '1px solid black' }}>Text 3</div>
        </div>
      </div>

      {/* Second Column */}
      <div style={{ flex: '1 1 50%' }}>
        {/* ImageView */}
        <div style={{ flex: '1', border: '1px solid black', textAlign: 'center' }}>
          <img
            src="https://via.placeholder.com/150"
            alt="Sample"
            style={{ maxWidth: '100%', maxHeight: '100%', objectFit: 'cover' }}
          />
        </div>
      </div>
    </div>
  );
};

export default SpecialOffers;
